import React from 'react';
import './Login.css';
import { Link } from "react-router-dom";

function Login() {
    return (
        <div className="login">
            <Link to="/">
                <img
                    className="header__logo"
                    src="http://pngimg.com/uploads/amazon/amazon_PNG11.png"
                />
            </Link>
        </div>
    )
}

export default Login;
